// src/UserProgressByRuleTree.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';

const UserProgressByRuleTree = () => {
  const [progress, setProgress] = useState(null);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      const auth = 'U2Vzc2lvbk1TaGFyZWQ6ZzdvYU1sSkR4UjlDRTFYa0duN21SOGlYYUxNdTlGeWQ='; // Base64 encoded credentials

      const payload = {
        retailer_id: 'ED0538AD-38AF-422F-8450-21FDF1A0FAE2',
        user_id: 'dcd393fe-3ff0-11ef-8048-69e7ac110003',
        ids: ['c45c9b1b-8859-4012-96b8-4f7159b7d1ac'],
        culture: 'en-US'
      };

      try {
        const response = await axios.post('https://domains-demoecon.ent-sessionm.com/incentives/api/1.0/progress/rule_tree/user_progress', payload, {
          headers: {
            'Content-Type': 'application/json',
            'Accept': 'application/json',
            'Authorization': `Basic ${auth}`
          },
        });
        setProgress(response.data);
      } catch (error) {
        setError(error);
      }
    };

    fetchData();
  }, []);

  if (error) return <div>Error: {error.message}</div>;
  if (!progress) return <div>Loading...</div>;

  return (
    <div>
      <h1>User Progress By Rule Tree</h1>
      <pre>{JSON.stringify(progress, null, 2)}</pre>
    </div>
  );
};

export default UserProgressByRuleTree;
